import axios from 'axios';
import React, { Component } from 'react'
import Data from '../Data/cars.json';


export class Audi extends Component {

    state = {
        carsAudi: []
    }


    componentDidMount() {
        axios.get("https://jsonplaceholder.typicode.com/posts")
            .then(res => {
                console.log(res.data);
                this.setState({ carsAudi: res.data })
            })

        fetch("../cars.json")
        .then(function(resp) {
            return resp.json();
        })
        .then(function(data){
            console.log(data);
        })
    }


    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">
                        {this.state.carsAudi.map(car =>
                        
                            <div>
                                <h2>{car.title}</h2>
                                <p>{car.body}</p>
                            </div>
                        )}
                        
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
